import React from 'react';

export default class FormSubmission extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return  (
      <div>
        <form action="https://www.youtube.com/results" method="GET">
          <input type="text" name="search_query" />
          <button type="submit">
            Submit
          </button>
        </form>
      </div>
    );
  }
}
